      out.write("    function gridListCheckBoxDrawBeforeEvent(gridId, rowNum){\r\n");
      out.write("\t\tif(gridId == \"gridItemList\"){\r\n");
      out.write("\t\t\tvar c00102 = gridList.getColData(gridId, rowNum, \"C00102\");\r\n");
