      out.write("\t//그리드 컬럼 변경 이벤트\r\n");
      out.write("\tfunction gridListEventColValueChange(gridId, rowNum, colName, colValue){\r\n");
      out.write("\t\tif(gridId == \"gridItemList\"){\r\n");
      out.write("\t\t\t if(colName == \"QTYREQ\" || colName == \"BOXQTY\" || colName == \"REMQTY\"){ //수량변경시연결된 수량 변경\r\n");
      out.write("\t\t\t\tvar qtyreq = 0;\r\n");
      out.write("\t\t\t\tvar boxqty = 0;\r\n");
      out.write("\t\t\t\tvar remqty = 0;\r\n");
      out.write("\t\t\t\tvar pltqty = 0;\r\n");
      out.write("\t\t\t\tvar grswgt = 0;\r\n");
      out.write("\t\t\t\tvar bxiqty = Number(gridList.getColData(gridId, rowNum, \"BXIQTY\"));\r\n");
      out.write("\t\t\t\tvar qtduom = Number(gridList.getColData(gridId, rowNum, \"QTDUOM\"));\r\n");
      out.write("\t\t\t\tvar pliqty = Number(gridList.getColData(gridId, rowNum, \"PLIQTY\"));\r\n");
      out.write("\t\t\t\tvar qtyorg = gridList.getColData(gridId, rowNum, \"QTYORG\");\r\n");
      out.write("\t\t\t\tvar remqtyChk = 0;\r\n");
      out.write("\t\t\t\t\r\n");
      out.write("\t\t\t  \tif( colName == \"QTYREQ\" ) { //납품요청수량 변경시\r\n");
      out.write("\t\t\t\t\t//납품요청수량과 원주문수량 비고\r\n");
      out.write("\t\t\t  \t\tif(Number(gridList.getColData(gridId, rowNum, \"QTYREQ\")) > Number(gridList.getColData(gridId, rowNum, \"QTYORG\"))){\r\n");
      out.write("\t\t\t\t\t\talert(\"* 납품요청수량이 원주문수량보다 큽니다. *\");\r\n");
      out.write("\t\t\t\t\t\tresetQty(gridId, rowNum);\r\n");
      out.write("\t\t\t\t\t\treturn false;\r\n");
      out.write("\t\t\t\t\t}\r\n");
      out.write("\t\t\t\t  \t//박스 수량 등을 계산하여 각 컬럼에 세팅\r\n");
      out.write("\t\t\t\t  \tqtyreq = colValue;\r\n");
      out.write("\t\t\t\t  \tboxqty = gridList.getColData(gridId, rowNum, \"BOXQTY\");\r\n");
      out.write("\t\t\t\t  \tremqty = gridList.getColData(gridId, rowNum, \"REMQTY\");\r\n");
      out.write("\t\t\t\t  \tboxqty = floatingFloor((Number)(qtyreq)/(Number)(bxiqty), 1);\r\n");
      out.write("\t\t\t\t  \tremqty = (Number)(qtyreq)%(Number)(bxiqty);\r\n");
      out.write("\t\t\t\t  \tpltqty = floatingFloor((Number)(qtyreq)/(Number)(pliqty), 2);\r\n");
      out.write("\t\t\t\t  \t\r\n");
      out.write("\t\t\t\t  \tgridList.setColValue(gridId, rowNum, \"BOXQTY\", boxqty);\r\n");
      out.write("\t\t\t\t\tgridList.setColValue(gridId, rowNum, \"REMQTY\", remqty);\r\n");
      out.write("\t\t\t\t\tgridList.setColValue(gridId, rowNum, \"PLTQTY\", pltqty);\r\n");
      out.write("\t\t\t\t\tgridList.setColValue(gridId, rowNum, \"GRSWGT\", grswgt);\r\n");
      out.write("\t\t\t\t  }\r\n");
      out.write("\t\t\t\t\r\n");
      out.write("\t\t\t\t  if( colName == \"BOXQTY\" ){ //박스수량 변경시\r\n");
      out.write("\t\t\t\t\t//박스수량을 낱개수량으로 변경하여 계산한다.\r\n");
      out.write("\t\t\t\t\tboxqty = colValue;\r\n");
      out.write("\t\t\t\t\tremqty = gridList.getColData(gridId, rowNum, \"REMQTY\");\r\n");
      out.write("\t\t\t\t\tqtyreq = (Number)(bxiqty) * (Number)(boxqty) + (Number)(remqty);\r\n");
      out.write("\t\t\t\t\tpltqty = floatingFloor((Number)(qtyreq)/(Number)(pliqty), 2);\r\n");
      out.write("\t\t\t\t  \t\r\n");
      out.write("\t\t\t\t\tif(Number(qtyreq) > Number(qtyorg)){\r\n");
      out.write("\t\t\t\t\t\talert(\"* 납품요청수량이 원주문수량보다 큽니다. *\");\r\n");
      out.write("\t\t\t\t\t\tresetQty(gridId, rowNum);\r\n");
      out.write("\t\t\t\t\t\treturn false;\r\n");
      out.write("\t\t\t\t\t}\r\n");
      out.write("\t\t\t\t  \t\r\n");
      out.write("\t\t\t\t  \t//계산한 수량 세팅\r\n");
      out.write("\t\t\t\t    gridList.setColValue(gridId, rowNum, \"QTYREQ\", qtyreq);\r\n");
      out.write("\t\t\t\t    gridList.setColValue(gridId, rowNum, \"PLTQTY\", pltqty);\r\n");
      out.write("\t\t\t\t  }\r\n");
      out.write("\t\t\t\t  \r\n");
      out.write("\t\t\t\t  if( colName == \"REMQTY\" ){ //잔량변경시\r\n");
      out.write("\t\t\t\t  \tqtyreq = gridList.getColData(gridId, rowNum, \"QTYREQ\");\r\n");
      out.write("\t\t\t\t  \tboxqty = gridList.getColData(gridId, rowNum, \"BOXQTY\");\r\n");
      out.write("\t\t\t\t  \tremqty = colValue;\t\r\n");
      out.write("\t\t\t\t  \t\r\n");
      out.write("\t\t\t\t  \t//잔량으로 박스수량 등 계산\r\n");
      out.write("\t\t\t\t  \tremqtyChk = (Number)(remqty)%(Number)(bxiqty);\r\n");
      out.write("\t\t\t\t  \tboxqty = (Number)(boxqty) + (Number)(floatingFloor((Number)(remqty)/(Number)(bxiqty), 0));\r\n");
      out.write("\t\t\t\t  \tqtyreq = (Number)(boxqty) * (Number)(bxiqty) + (Number)(remqtyChk);\r\n");
      out.write("\t\t\t\t  \tpltqty = floatingFloor((Number)(qtyreq)/(Number)(pliqty), 2);\r\n");
      out.write("\t\t\t\t  \t\r\n");
      out.write("\t\t\t\t  \tif(Number(qtyreq) > Number(qtyorg)){\r\n");
      out.write("\t\t\t\t\t\talert(\"* 납품요청수량이 원주문수량보다 큽니다. *\");\r\n");
      out.write("\t\t\t\t\t\tresetQty(gridId, rowNum);\r\n");
      out.write("\t\t\t\t\t\treturn false;\r\n");
      out.write("\t\t\t\t\t}\r\n");
      out.write("\t\t\t\t  \t\r\n");
      out.write("\t\t\t\t  \t//수량 세팅\r\n");
      out.write("\t\t\t\t\tgridList.setColValue(gridId, rowNum, \"REMQTY\", remqtyChk);\r\n");
      out.write("\t\t\t\t\tgridList.setColValue(gridId, rowNum, \"BOXQTY\", boxqty);\r\n");
      out.write("\t\t\t\t\tgridList.setColValue(gridId, rowNum, \"PLTQTY\", pltqty);\t\r\n");
      out.write("\t\t\t\t\tgridList.setColValue(gridId, rowNum, \"QTYREQ\", qtyreq);\r\n");
